import { GoogleMap , withScriptjs , withGoogleMap , Marker} from 'react-google-maps';
import mapMarkers from './markers';

export function defaultMap(){
    return(
        <GoogleMap defaultZoom = {12} 
        defaultCenter = {{lat : 46.770920 , lng : 23.589920}}>
            {mapMarkers.map((currentMarker) => {
                return (
                    <Marker key = {currentMarker.key} position = {currentMarker.position} icon = {currentMarker.icon}/> 
                )
            })}
        </GoogleMap>
    );
}
